/* eslint-disable no-restricted-syntax, no-empty-function */
'use strict';

var isDateObject = require( './../lib' );

console.log( isDateObject( new Date() ) );
// => true

console.log( isDateObject( '2017-01-01' ) );
// => false

console.log( isDateObject( 5 ) );
// => false

console.log( isDateObject( null ) );
// => false

console.log( isDateObject( void 0 ) );
// => false

console.log( isDateObject( {} ) );
// => false

console.log( isDateObject( [] ) );
// => false

console.log( isDateObject( function Date() {} ) );
// => false
